import React, { useRef, useState } from 'react';
import { motion } from 'framer-motion';
import emailjs from '@emailjs/browser';

const ContactModal = ({ isOpen, onClose }) => {
  const form = useRef();
  const [status, setStatus] = useState("Send Inquiry");

  if (!isOpen) return null;

  const handleContactSubmit = (e) => {
    e.preventDefault();
    setStatus("Sending...");

    // COPY THESE CAREFULLY FROM YOUR EMAILJS DASHBOARD
    const SERVICE_ID = "service_xxxxxxx"; // Found in 'Email Services'
    const TEMPLATE_ID = "template_xxxxxxx"; // Found in 'Email Templates'
    const PUBLIC_KEY = "xxxxxxxxxxxxxxxxx"; // Found in 'Account' -> 'Public Key'

    emailjs.sendForm(SERVICE_ID, TEMPLATE_ID, form.current, PUBLIC_KEY)
      .then(() => {
        setStatus("Message Sent!");
        setTimeout(() => { setStatus("Send Inquiry"); onClose(); }, 2000);
      })
      .catch((error) => {
        console.error("FULL ERROR DETAILS:", error);
        setStatus("Error: Check Console");
      });
  };

  return (
    <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} style={styles.overlay} onClick={onClose}>
      <motion.div initial={{ y: 50 }} animate={{ y: 0 }} style={styles.modal} onClick={(e) => e.stopPropagation()}>
        <button onClick={onClose} style={styles.closeBtn}>Ã—</button>
        <h2 style={{color: '#fff', textAlign: 'center', marginBottom: '30px'}}>Contact <span style={{color: '#2ecc71'}}>Us</span></h2>
        <form ref={form} onSubmit={handleContactSubmit} style={styles.form}>
          <div style={styles.row}>
            <div style={styles.inputGroup}>
              <label style={styles.label}>Full Name</label>
              <input name="from_name" type="text" required style={styles.input} />
            </div>
            <div style={styles.inputGroup}>
              <label style={styles.label}>Email Address</label>
              <input name="from_email" type="email" required style={styles.input} />
            </div>
          </div>
          <div style={styles.inputGroup}>
            <label style={styles.label}>Message</label>
            <textarea name="message" required style={{...styles.input, height: '120px'}}></textarea>
          </div>
          <button type="submit" style={styles.submitBtn}>{status}</button>
        </form>
      </motion.div>
    </motion.div>
  );
};

const styles = {
  overlay: { position: 'fixed', top: 0, left: 0, width: '100vw', height: '100vh', background: 'rgba(0,0,0,0.9)', zIndex: 2000, display: 'flex', justifyContent: 'center', alignItems: 'center' },
  modal: { background: '#111', width: '90%', maxWidth: '600px', borderRadius: '20px', padding: '40px', position: 'relative', border: '1px solid #222' },
  closeBtn: { position: 'absolute', top: '15px', right: '20px', background: 'none', border: 'none', color: '#fff', fontSize: '1.5rem', cursor: 'pointer' },
  form: { display: 'flex', flexDirection: 'column', gap: '20px' },
  row: { display: 'flex', gap: '20px', flexWrap: 'wrap' },
  inputGroup: { flex: 1, display: 'flex', flexDirection: 'column', gap: '8px' },
  label: { color: '#2ecc71', fontSize: '0.8rem', fontWeight: 'bold' },
  input: { background: '#f0f4f8', border: 'none', padding: '15px', borderRadius: '10px', color: '#000', outline: 'none' },
  submitBtn: { background: '#2ecc71', color: '#000', border: 'none', padding: '18px', borderRadius: '12px', fontWeight: 'bold', cursor: 'pointer' }
};

export default ContactModal;
